import '../../../assets/styles/buttons/cta-button1.css';
import BetaSection from '../../organisms/layout/beta/beta-service';
import Header from '../../organisms/layout/header';

const BetaPage = () => {
    return (
      <div className="landing-page">
        <Header />
        <BetaSection />
